import React from 'react';
import props from 'prop-types';
import DoctorComponent from './DoctorComponent';
import LoginComponent from './LoginComponent';
import NavigationComponent from './NavigationComponent';

class MainAPP extends React.Component{
    constructor(props){
        super(props);
        this.navElement = React.createRef();
    }
    render(){
        return(
        <>

            <NavigationComponent ref={this.navElement} />
            <div>{<DoctorComponent/> ? this.navElement.current.state.clicked==="doctors":null}</div>
            <div>{<LoginComponent/> ? this.navElement.current.clicked==="login":null}</div>

        </>
        );



    }
}

export default MainAPP;
